async function seed() {
  await mongoose.connect(process.env.MONGODB_URI, {
    useNewUrlParser: true,
    useUnifiedTopology: true,
  });
  await Skin.deleteMany({});
  await Skin.insertMany(sampleSkins);
  console.log('Sample skins seeded!');
  mongoose.disconnect();
}

seed();
